const styles = (theme) => ({
  container: {
    overflowY: 'auto',
    paddingLeft: 32,
    paddingRight: 32,
  },
  spacingContainer: {
    margin: theme.spacing(3, 0, 5, 0),
  },
  detailsCardTitle: {
    fontSize: `${theme.typography.pxToRem(13)} !important`,
  },
  detailsCardText: {
    fontSize: `${theme.typography.pxToRem(12)} !important`,
  },
});

export default styles;
